// ==UserScript==
// @name         NJU验证码自动填充
// @namespace    https://github.com/yama-lei/nju-captcha-extension
// @version      1.0.2
// @description  南京大学统一身份认证验证码自动识别填充脚本，使用本地 ONNX 模型识别。
// @author       yama-lei
// @match        *://authserver.nju.edu.cn/*
// @match        *://iaaa.nju.edu.cn/*
// @require      https://cdn.jsdelivr.net/npm/onnxruntime-web@1.22.0/dist/ort.min.js
// @grant        none
// @nocompat     Chrome
// ==/UserScript==

(function () {
    'use strict';

    // ============ DEBUG MODE ============
    const DEBUG = false;

    function log(...args) {
        if (DEBUG) console.log('[NJU Captcha]', ...args);
    }

    function warn(...args) {
        console.warn('[NJU Captcha]', ...args);
    }

    function error(...args) {
        console.error('[NJU Captcha]', ...args);
    }

    const MODEL_BASE64 = ``;
    function base64ToUint8Array(base64) {
        const binaryString = atob(base64);
        const len = binaryString.length;
        const bytes = new Uint8Array(len);
        for (let i = 0; i < len; i++) {
            bytes[i] = binaryString.charCodeAt(i);
        }
        return bytes.buffer;
    }

    // ============ Helper: Fetch with GM_xmlhttpRequest to bypass CSP ============
    function gmFetch(url) {
        return new Promise((resolve, reject) => {
            GM_xmlhttpRequest({
                method: 'GET',
                url: url,
                responseType: 'arraybuffer',
                onload: function (response) {
                    if (response.status >= 200 && response.status < 300) {
                        resolve(response.response);
                    } else {
                        reject(new Error(`HTTP ${response.status}: ${response.statusText}`));
                    }
                },
                onerror: function (err) {
                    reject(new Error('Network error: ' + err));
                }
            });
        });
    }

    // ============ NJU Captcha OCR Class ============
    class NJUCaptchaOCR {
        constructor() {
            this.CHARACTERS = '0123456789abcdefghijklmnopqrstuvwxyz'.split('');
            this.NUM_CLASSES = 36;
            this.CAPTCHA_LENGTH = 4;
            this.RESIZE_WIDTH = 48;
            this.RESIZE_HEIGHT = 32;

            this.session = null;
            this.isLoadingModel = false;

            // Set WASM paths for ONNX Runtime
            ort.env.wasm.wasmPaths = "https://cdn.jsdelivr.net/npm/onnxruntime-web@1.22.0/dist/";
        }

        async loadModel() {
            if (this.session || this.isLoadingModel) return;
            this.isLoadingModel = true;

            log('Loading embedded ONNX model...');

            try {
                const modelBuffer = base64ToUint8Array(MODEL_BASE64);
                log('Model decoded, size:', modelBuffer.byteLength, 'bytes');

                this.session = await ort.InferenceSession.create(modelBuffer, {
                    executionProviders: ['wasm']
                });
                log('Model loaded successfully!');
            } catch (e) {
                error('Failed to load ONNX model:', e);
                throw e;
            } finally {
                this.isLoadingModel = false;
            }
        }

        preprocessImageSlice(imageElement, charPos) {
            log('Preprocessing image...');
            log('Image dimensions:', imageElement.naturalWidth, 'x', imageElement.naturalHeight);

            const canvas = document.createElement('canvas');
            canvas.width = this.RESIZE_WIDTH;
            canvas.height = this.RESIZE_HEIGHT;
            const ctx = canvas.getContext('2d');

            const srcW = imageElement.naturalWidth || 80;
            const srcH = imageElement.naturalHeight || 30;
            const sliceW = Math.floor(srcW / this.CAPTCHA_LENGTH);
            const sx = charPos * sliceW;
            const sw = (charPos === this.CAPTCHA_LENGTH - 1) ? (srcW - sx) : sliceW;

            // Draw one captcha slice resized to model input
            ctx.drawImage(imageElement, sx, 0, sw, srcH, 0, 0, this.RESIZE_WIDTH, this.RESIZE_HEIGHT);

            // Get image data
            const imageData = ctx.getImageData(0, 0, this.RESIZE_WIDTH, this.RESIZE_HEIGHT);
            const data = imageData.data;

            // Convert to float32 tensor in CHW format. Training used ToTensor only.
            const float32Data = new Float32Array(3 * this.RESIZE_HEIGHT * this.RESIZE_WIDTH);

            for (let i = 0; i < this.RESIZE_HEIGHT * this.RESIZE_WIDTH; i++) {
                const r = data[i * 4] / 255.0;
                const g = data[i * 4 + 1] / 255.0;
                const b = data[i * 4 + 2] / 255.0;

                float32Data[i] = r;
                float32Data[i + this.RESIZE_HEIGHT * this.RESIZE_WIDTH] = g;
                float32Data[i + 2 * this.RESIZE_HEIGHT * this.RESIZE_WIDTH] = b;
            }

            return new ort.Tensor('float32', float32Data, [1, 3, this.RESIZE_HEIGHT, this.RESIZE_WIDTH]);
        }

        decodeSingleChar(outputTensor, pos) {
            const outputData = outputTensor.data;
            log('Output tensor shape:', outputTensor.dims);
            log('Output data length:', outputData.length);
            let maxIdx = 0;
            let maxScore = outputData[0];
            for (let j = 1; j < outputData.length; j++) {
                if (outputData[j] > maxScore) {
                    maxScore = outputData[j];
                    maxIdx = j;
                }
            }
            const ch = this.CHARACTERS[maxIdx] || '';
            log(`Position ${pos}: maxIdx=${maxIdx}, char='${ch}', score=${Number(maxScore).toFixed(4)}`);
            return ch;
        }

        async classify(imageElement) {
            if (!this.session && !this.isLoadingModel) {
                await this.loadModel();
            }

            // Wait for model to load
            let attempts = 0;
            const maxAttempts = 20;
            while (!this.session && attempts < maxAttempts) {
                await new Promise(resolve => setTimeout(resolve, 500));
                attempts++;
            }

            if (!this.session) {
                warn('Model not loaded after waiting.');
                return "";
            }

            const startTime = performance.now();
            let text = '';
            for (let i = 0; i < this.CAPTCHA_LENGTH; i++) {
                const inputTensor = this.preprocessImageSlice(imageElement, i);
                const feeds = { 'input': inputTensor };
                const results = await this.session.run(feeds);
                const outputTensor = Object.values(results)[0];
                text += this.decodeSingleChar(outputTensor, i);
            }
            const inferenceTime = performance.now() - startTime;
            log('Inference time:', inferenceTime.toFixed(2), 'ms');
            log('Recognition result:', text);

            return text;
        }
    }

    // ============ Main Logic ============
    const ocr = new NJUCaptchaOCR();

    async function processCaptcha(imgElement) {
        log('========== Processing captcha ==========');

        try {
            if (!imgElement) {
                throw new Error('Image element is null');
            }

            // Wait for image to load if necessary
            if (!imgElement.complete) {
                log('Image not complete, waiting...');
                await new Promise((resolve, reject) => {
                    imgElement.onload = resolve;
                    imgElement.onerror = () => reject(new Error('Image failed to load'));
                    setTimeout(() => reject(new Error('Image load timeout')), 5000);
                });
            }

            if (imgElement.naturalWidth === 0 || imgElement.naturalHeight === 0) {
                throw new Error('Image has zero dimensions');
            }

            // Run OCR
            const captchaText = await ocr.classify(imgElement);

            // Fill the input field
            const inputField = document.querySelector('#captchaResponse');
            log('Input field found:', !!inputField);

            if (inputField) {
                inputField.value = captchaText;
                inputField.dispatchEvent(new Event('input', { bubbles: true }));
                inputField.dispatchEvent(new Event('change', { bubbles: true }));
                log('Captcha filled successfully!');
            } else {
                // Try alternative selectors
                const altInput = document.querySelector('input[name="captchaResponse"]') ||
                    document.querySelector('input[placeholder*="验证码"]');
                if (altInput) {
                    altInput.value = captchaText;
                    altInput.dispatchEvent(new Event('input', { bubbles: true }));
                    log('Filled alternative input field');
                } else {
                    warn('No captcha input field found');
                }
            }

            log('========== Processing complete ==========');
        } catch (err) {
            error('Error processing captcha:', err);
        }
    }

    function waitForElement(selector, callback, timeout = 10000) {
        log('Waiting for element:', selector);

        const element = document.querySelector(selector);
        if (element) {
            log('Element found immediately:', selector);
            callback(element);
            return;
        }

        const observer = new MutationObserver((mutations, obs) => {
            const element = document.querySelector(selector);
            if (element) {
                log('Element found via MutationObserver:', selector);
                obs.disconnect();
                callback(element);
            }
        });

        observer.observe(document.body, {
            childList: true,
            subtree: true,
        });

        setTimeout(() => {
            observer.disconnect();
            warn('Timeout waiting for element:', selector);
        }, timeout);
    }

    function setupImageObserver(img) {
        log('Setting up image observer for captcha refresh');

        // Listen for click (user clicks to refresh)
        img.addEventListener('click', () => {
            log('Image clicked, will reprocess after load');
            setTimeout(() => {
                const newImg = document.querySelector('#captchaImg');
                if (newImg) {
                    if (newImg.complete && newImg.naturalHeight !== 0) {
                        processCaptcha(newImg);
                    } else {
                        newImg.addEventListener('load', () => processCaptcha(newImg), { once: true });
                    }
                }
            }, 300);
        });

        // Watch for src attribute changes
        const srcObserver = new MutationObserver((mutations) => {
            for (const mutation of mutations) {
                if (mutation.type === 'attributes' && mutation.attributeName === 'src') {
                    log('Image src changed, will reprocess');
                    const target = mutation.target;
                    if (target.complete && target.naturalHeight !== 0) {
                        processCaptcha(target);
                    } else {
                        target.addEventListener('load', () => processCaptcha(target), { once: true });
                    }
                }
            }
        });

        srcObserver.observe(img, { attributes: true, attributeFilter: ['src'] });
    }

    async function main() {
        log('========================================');
        log('NJU Captcha Auto-Fill Script Started');
        log('URL:', window.location.href);
        log('========================================');

        // Start loading model in background
        ocr.loadModel().then(() => {
            log('Background model loading completed');
        }).catch(err => {
            error('Background model loading failed:', err);
        });

        // Wait for captcha image
        waitForElement('#captchaImg', async (img) => {
            log('Captcha image element found');

            // Setup observer for future refreshes
            setupImageObserver(img);

            // Process current image
            if (img.complete && img.naturalHeight !== 0) {
                log('Image already loaded, processing immediately');
                await processCaptcha(img);
            } else {
                log('Image not yet loaded, waiting for load event');
                img.addEventListener('load', () => {
                    log('Image load event fired');
                    processCaptcha(img);
                }, { once: true });
            }
        });
    }

    // Run when DOM is ready
    if (document.readyState === 'loading') {
        log('Document still loading, waiting for DOMContentLoaded');
        document.addEventListener('DOMContentLoaded', main);
    } else {
        log('Document already loaded, running main immediately');
        main();
    }
})();
